export default (state = '', action) => {
  switch (action.type) {
    
    case 'INDEX_ME':
      Object.values(action.payload)
      return action.payload.map(  (me) =>
        <li key={me.id}> 
          {me.id}
          {me.name}
          {me.email}
          <button>comprar</button>
        </li>
      );

    default:
      return state;
  }
}
